export function Deposit() {

    const onDeposit = (e) => {

        const acId = e.target.acId.value;
        const amount = e.target.amount.value;

        console.log(`id ${acId} Amount ${amount}`)

        fetch('http://localhost:3000/deposit', {
            method : 'PUT',
            headers : {
                'Accept' : 'application/json',
                'Content-Type' : 'application/json'
            },
            body : JSON.stringify({ acId, amount })
        }).then( res => res.json() )
        .then(json => console.log(json))

    }

    <div className={StyleSheet.depCont}>
        <h1> Deposit Amount </h1>
        <form on Submit = {onDeposit}>
            <input type='number' placeHolder='Account Id' name='acId'/>
            <input type='number' placeHolder='Amount' name='amount'/>
            <input type='submit' value='deposit'/>
        </form>
    </div>

}
